import icon3 from './images/icon3.png';
const DeleteBtn = ({handleDeleteBtnClick , index}) => {
  return (
    <img
    src={icon3}
    alt="icon"
    title="Delete"
    onClick={() => handleDeleteBtnClick(index)}
    className="deleteBtn"
  />
  )
}

export default DeleteBtn
